import React from 'react';

export default function SessionExpiredModal({ onClose }) {
  return (
    <div className="modal-backdrop">
      <div className="modal">
        <h2>Session Expired</h2>
        <p>Please log in again to continue.</p>
        <button onClick={onClose}>OK</button>
      </div>
    </div>
  );
}
